import React, { Component } from "react";
import Col from "react-bootstrap/Col";
import Dropdown from "react-bootstrap/Dropdown";
import Badge from "react-bootstrap/Badge";

export default class SortDropDown extends Component {
    render() {
        return (
            <div>
                <Col sm={3} xs={3} md={3} lg={3}>
                    <Dropdown>
                        <Dropdown.Toggle
                            variant="primary"
                            id="dropdownMenu1"
                            aria-haspopup="true"
                            aria-expanded="true"
                        >
                            Sort by
                        </Dropdown.Toggle>
                        <Dropdown.Menu>
                            <Dropdown.Item>Name ASC</Dropdown.Item>
                            <Dropdown.Item>Name DESC</Dropdown.Item>
                            <Dropdown.Item>Level ASC</Dropdown.Item>
                            <Dropdown.Item>Level DESC</Dropdown.Item>
                        </Dropdown.Menu>

                        <Badge>NAME-DESC</Badge>
                    </Dropdown>
                </Col>
            </div>
        );
    }
}
